–¥–∞–ª–¥ —Ö“Ø—Ä–≥—ç—Å—ç–Ω “Ø–π–ª —è–≤–¥–ª—É—É–¥.\n7) –£—Ö–∞–º—Å–∞—Ä—Ç–∞–π ‚Äî $consciousCard (45-55 “Ø–≥): $userName-–∏–π–Ω –∑–æ—Ä–∏–ª–≥–æ, —Ö“Ø–ª—ç—ç–ª—Ç —ç—Å–≤—ç–ª —É—Ö–∞–º—Å–∞—Ä–ª–∞—Å–∞–Ω –∑“Ø–π–ª—Å.\n8) –û–π—Ä—ã–Ω –∏—Ä—ç—ç–¥“Ø–π ‚Äî $hiddenCard (45-55 “Ø–≥): –∏—Ä—ç—Ö —Ö—ç–¥—ç–Ω –¥–æ–ª–æ–æ —Ö–æ–Ω–æ–≥—Ç –±–æ–ª–æ—Ö –º–∞–≥–∞–¥–ª–∞–ª—Ç–∞–π —Ö”©–≥–∂–∏–ª.\n9) –î–æ—Ç–æ–æ–¥ –±–∏ ‚Äî $selfCard (45-55 “Ø–≥): $userName-–∏–π–Ω —Å—ç—Ç–≥—ç–ª –∑“Ø–π–Ω –±–∞–π–¥–∞–ª, –Ω”©”©—Ü –±–æ–ª–æ–ª—Ü–æ–æ.\n10) –û—Ä—á–∏–Ω ‚Äî $environmentCard (45-55 “Ø–≥): —Ö“Ø–º“Ø“Ø—Å –±–æ–ª–æ–Ω –Ω”©—Ö—Ü”©–ª –±–∞–π–¥–ª—ã–Ω –Ω”©–ª”©”©.\n11) –ù–∞–π–¥–ª–∞–≥–∞ / –∞–π–¥–∞—Å ‚Äî $hopesCard (45-55 “Ø–≥): $userName-–∏–π–Ω —Ö“Ø–ª—ç—ç–ª—Ç —ç—Å–≤—ç–ª —Å–∞–Ω–∞–∞ –∑–æ–≤–Ω–∏–ª.\n12) –î“Ø–Ω ‚Äî $outcomeCard (45-55 “Ø–≥): —Ç–∞—Ä–æ –¥—ç–ª–≥—ç—Ü–∏–π–Ω –∑”©–≤–ª”©–≥”©”©–≥ —Ö–∞—Ä–≥–∞–ª–∑–∞–Ω “Ø–∑—Å—ç–Ω –º–∞–≥–∞–¥–ª–∞–ª—Ç–∞–π “Ø—Ä –¥“Ø–Ω.\n13) –¢”©–≥—Å–≥”©–ª: $userName-–¥ –∑–æ—Ä–∏—É–ª—Å–∞–Ω –Ω–∞–π—Ä—Å–∞–≥ –¥—ç–º–∂–ª—ç–≥ –±–∞ —ç–µ—Ä—ç–≥ –±–∞—Ç–ª–∞–º–∂ (30-35 “Ø–≥).\n–ù–∏–π—Ç —Ö—ç–º–∂—ç—ç 400-500 “Ø–≥, –∞–º—å–¥ —è—Ä–∏–∞–Ω—ã —Ö—ç–≤ –º–∞—è–≥—Ç–∞–π, 4-6 —ç–∑–æ—Ç–µ—Ä–∏–∫ —Å–º–∞–π–ª–∏–∫—Ç—ç–π; –±–ª–æ–∫ –±“Ø—Ä–∏–π–≥ —Ö–æ—ë—Ä–æ–æ—Ä —Ö–æ–æ—Å–æ–Ω –º”©—Ä”©”©—Ä —Ç—É—Å–≥–∞–∞—Ä–ª–∞–Ω–∞ —É—É; *,# –±–æ–ª–æ–Ω –±—É—Å–∞–¥ —Ç—ç–º–¥—ç–≥–ª—ç–≥—ç—ç–≥ –±“Ø“Ø –∞—à–∏–≥–ª–∞; –∑”©–≤—Ö”©–Ω —ç–Ω–≥–∏–π–Ω —Ç–µ–∫—Å—Ç—ç—ç—Ä –±–∏—á–Ω—ç “Ø“Ø.';
